import React, { Component } from "react";

import ErrorView from "../AppContent/Error404";
import HomeView from "../AppContent/HomeContent";
import ShopView from "../AppContent/ShopContent";
import LoginView from "../AppContent/LoginContent";
import RegisterView from "../AppContent/RegisterContent";

const AppContent = function (props) {
    const route = props.route;
    let content = <div className="imageBlur"><img src="https://www.incimages.com/uploaded_files/image/1940x900/getty_663974538_353364.jpg" /></div>;
    if(route === "home"){
        return (<HomeView />);
    }
    if(route === "shop"){
        return (<ShopView />);
    }
    if(route === "login"){
        return (<LoginView />);
    }
    if(route === "register"){
        return (<RegisterView />);
    }
    return (<ErrorView/>);
}

export default AppContent;
